import React from 'react';

const styles = {
    image: {
        width: '20%',
        minWidth: '200px',
        height: '20%',
        minHeight: '200px',
        borderRadius: '25%',
        borderColor: 'black',
        borderWidth: '5px',
        marginLeft: '20%',
        marginTop: '20%'
    }
}

const About = () => {

    return (

        <>
            <div className='portfoliocontainer'>
                <img src='https://avatars0.githubusercontent.com/u/54956992?s=460&v=4' alt='picture' style={styles.image} />
            </div>
        </>
    )
}
export default About
